export class HashSet {
    constructor() {
        this._data = [];
        this._hashes = {};
    }
    add(item) {
        let code = item.hashCode();
        if (this._hashes[code] !== true) {
            this._hashes[code] = true;
            this._data.push(item);
        }
    }
    has(item) {
        let code = item.hashCode();
        return this._hashes[code] === true;
    }
    forEach(callback) {
        this._data.forEach(callback);
    }
}
